pping------------------//\n    async updateContactEmailMapping(cei_code, data){\n        var output = await this.contactEmailMapping.findOne({where: {cei_code:cei_code}})\n        if(!output){\n            throw new NotFoundException(`${cei_code} is not exist`)\n        }\n        var result = await this.contactEmailMapping.update(cei_code, data)\n        if(result){\n            var msg = {message : \"Updated successfully\"}\n            return msg\n        }\n    }\n\n    //------------------Delete single record from contact_email_mapping------------------//\n    async deleteContactEmailMapping(cei_code){\n        var output = await this.contactEmailMapping.findOne({where: {cei_code:cei_code}})\n        if(!output){\n            throw new NotFoundException(`${cei_code} is not exist`)\n        }\n        var result = await this.contactEmailMapping.delete(cei_code)\n        if(result){\n            var msg = {message : \"Deleted successfully\"}\n            return msg\n        }\n    }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules/ContactEmailModule.html":{"url":"modules/ContactEmailModule.html","title":"module - ContactEmailModule","body":"\n                   \n\n\n\n\n    Modules\n    ContactEmailModule\n\n\n\n    \n        \n\n\n\n\n\ndependencies\n\ndependencies\n\ncluster_ContactEmailModule\n\n\n\ncluster_ContactEmailModule_imports\n\n\n\n\nContactEmailMappingAttachmentModule\n\nContactEmailMappingAttachmentModule\n\n\n\nContactEmailModule\n\nContactEmailModule\n\nContactEmailModule -->\n\nContactEmailMappingAttachmentModule->ContactEmailModule\n\n\n\n\n\nContactEmailMappingModule\n\nContactEmailMappingModule\n\nContactEmailModule -->\n\nContactEmailMappingModule->ContactEmailModule\n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n